import React from "react";
import Calendar from "./Calendar";
import { useParams } from "react-router-dom/cjs/react-router-dom.min";

function Profile({ artists }) {
    const { name } = useParams()
    const currentArtist = artists.find((artist) => artist.name === name);

    // Extract appointments for the current artist
    const appointments = currentArtist ? currentArtist.appointments || []: [];

    return (<div>
        <div>
            <h1>{name}'s Appointments</h1>
            {appointments.length > 0 ? (
                <ul>
                    {appointments.map((appointment) => (
                        <li key={appointment.id}>
                            {/* Display appointment details */}
                            Date: {appointment.date}, Time: {appointment.time}
                        </li>
                    ))}
                </ul>
            ) : (
                <p>No appointments for {name}.</p>
            )}
        </div>
        <Calendar />
    </div>
    )
}

export default Profile
